import Data from "../../../db/db.json"
import DataSetCard from './datasetCard'

function Home() {
    console.log(Data);
    return (
        <div className="home">
            { Data.dataSets.map((item) => (
                <DataSetCard dataSet={item} key={item.ObjectID} />
            )) }
        </div>
    );
}

export default Home;
